import React from 'react'
const url = `https://api.tomorrow.io/v4/timelines?location=-73.98529171943665,40.75872069597532&fields=temperature&timesteps=1h&units=metric&apikey=Mm0XJsU6iRXx03vAyTJFCQ0ajnttZH1U`
export function EventList({events}) {
  return (
    <div>{events.map(e=>(
        <div key={e.id}>
            {e.summary}
            <p>{e.location}</p>

        </div>
    ))}</div>
  )
}
